def diffize(model, id, marc1, marc2)
  
    lines1 = marc1.split("\n")
    lines2 = marc2.split("\n")

    diffs = Diff::LCS.sdiff(lines1, lines2)

    diffs.each do |diff|
    case diff.action
#    when '='
    when '!'
        #puts "Line #{diff.old_position + 1} changed:"
        puts "#{model}-#{id} ORIG #{diff.old_element}"
        puts "#{model}-#{id} NEW  #{diff.new_element}"
    when '-'
        # Line was removed
        puts "#{model}-#{id} REMOVED #{diff.old_element}"
    when '+'
        # Line was added
        puts "#{model}-#{id} ADDED   #{diff.new_element}"
    end
    end

end

mc = MarcConfigCache.get_configuration("source")


rows = CSV.parse(tsv, col_sep: "\t", headers: %i[rid old new]) 

rows.each do |r|

  next if !r[:new]

  pairs = r[:new].split(",")
              .map do |token|
                #ap token
              token.strip!                  # clean up any extra spaces
              token =~ /(.*)\((\d+)\)\s*\z/ # grab everything up to the *last* (number)
               if $1
                name = $1.strip               # $1 = full name (it may contain its own () )
                qty  = $2.to_i                # $2 = the numeric quantity
              else
                name = token
                qty = 0
              end
              [name, qty]
            end

  s = Source.find(r[:rid])
  marc1 = s.marc_source
#p s.marc["594"]
  s.marc["594"].each {|t| t.destroy_yourself}

  pairs.each do |pair|
    n594 = MarcNode.new("source", "594", "", mc.get_default_indicator("594"))
    n594.add_at(MarcNode.new("source", "b", pair[0], nil), 0 )
    n594.add_at(MarcNode.new("source", "c", pair[1], nil), 1 )
    n594.sort_alphabetically
    s.marc.root.add_at(n594, s.marc.get_insert_position("594") )
  end

  #p s.marc["594"]
  #
  s.paper_trail_event = "Edit 594 from Cornetto project"
  s.save

  marc2 = s.marc_source
  diffize(s.class.to_s, s.id, marc1, marc2)
end